select person.uuid, encounter.uuid
from person
       join patient p on person.person_id = p.patient_id
       join encounter on p.patient_id = encounter.patient_id
       join patient_identifier pi on p.patient_id = pi.patient_id and pi.identifier like 'TRI%'
       join (
            select person_id, encounter_id, cn.name
            from obs
                   join concept c on c.concept_id = obs.concept_id
                   join concept_name cn on c.concept_id = cn.concept_id
            where c.is_set = true
              and cn.name = 'Vitals') records_with_vitals on records_with_vitals.encounter_id = encounter.encounter_id and
